import { registerDynImportEntry } from 'js/moduleLoader';
registerDynImportEntry('js/theme.service', () => import('js/theme.service'));;
export default {
    "actions": {
        "setLightTheme": {
            "actionType": "JSFunction",
            "method": "setTheme",
            "inputData": {
                "0": "ui-lightTheme"
            },
            "deps": "js/theme.service"
        },
        "setDarkTheme": {
            "actionType": "JSFunction",
            "method": "setTheme",
            "inputData": {
                "0": "ui-darkTheme"
            },
            "deps": "js/theme.service"
        }
    },
    "commandHandlers": {
        "Awp0ChangeThemeHandler": {
            "id": "Awp0ChangeTheme",
            "activeWhen": true
        },
        "Awp0ShowLightThemeHandler": {
            "id": "Awp0ShowLightTheme",
            "action": "setLightTheme",
            "activeWhen": true,
            "visibleWhen": {
                "condition": "conditions.supportsLightTheme"
            },
            "selectWhen": {
                "condition": "conditions.isLightTheme"
            }
        },
        "Awp0ShowDarkThemeHandler": {
            "id": "Awp0ShowDarkTheme",
            "action": "setDarkTheme",
            "activeWhen": true,
            "visibleWhen": {
                "condition": "conditions.supportsDarkTheme"
            },
            "selectWhen": {
                "condition": "conditions.isDarkTheme"
            }
        }
    },
    "commandPlacements": {
        "Awp0ChangeThemePlacement": {
            "id": "Awp0ChangeTheme",
            "uiAnchor": "aw_globalToolbar",
            "priority": -1,
            "showGroupSelected": false
        }
    },
    "commands": {
        "Awp0ChangeTheme": {
            "iconId": "cmdSettings",
            "title": "{{i18n.changeThemeCommand}}",
            "isGroup": true,
            "description": "{{i18n.Awp0ChangeThemeDesc}}"
        },
        "Awp0ShowLightTheme": {
            "iconId": "cmdSettings",
            "title": "{{i18n.lightTheme}}"
        },
        "Awp0ShowDarkTheme": {
            "iconId": "cmdSettings",
            "title": "{{i18n.darkTheme}}"
        }
    },
    "conditions": {
        "supportsLightTheme": {
            "expression": "!ctx.changeThemeDisabled"
        },
        "supportsDarkTheme": {
            "expression": "!ctx.changeThemeDisabled"
        },
        "isLightTheme": {
            "expression": "ctx.theme === 'ui-lightTheme'"
        },
        "isDarkTheme": {
            "expression": "ctx.theme === 'ui-darkTheme'"
        },
        "isColumnFilteringOn": {
            "expression": "ctx.columnFilter.isFilteringOn === true"
        },
        "isColumnFilteringOff": {
            "expression": "ctx.columnFilter.isFilteringOn === false"
        }
    },
    "i18n": {
        "changeThemeCommand": [
            "UIMessages"
        ],
        "lightTheme": [
            "UIMessages"
        ],
        "darkTheme": [
            "UIMessages"
        ],
        "fullScreenCommand": [
            "UIMessages"
        ],
        "fullScreenCommandExit": [
            "UIMessages"
        ],
        "arrange": [
            "UIMessages"
        ],
        "showFiltersTitle": [
            "UIMessages"
        ],
        "hideFiltersTitle": [
            "UIMessages"
        ],
        "Awp0ChangeThemeDesc": [
            "UIMessages"
        ]
    }
};
